import React from 'react';
import './App.css';
import PreRegistrationForm from './PreRegistrationForm';

function App() {
  return (
    <div className="App">
      <div className="content">
        <header className="App-header">
          <h1>사전등록</h1>
          <img src="/unnamed.webp" alt="게임 캐릭터" className="character-image" />
        </header>
        <main>
          <PreRegistrationForm />
        </main>
      </div>
    </div>
  );
}

export default App;
